  return (
    <Fragment>
      <MobileLayoutLevel2 title="變更資料">
        <div className={css.mobileEmpty} />
        <div className={css.mobileBox}>
          <Tabs defaultIndex={1} onSelect={index => console.log(index)}>
            <TabList>
              <Tab>Title 1</Tab>
              <Tab>Title 2</Tab>
            </TabList>
            <TabPanel>1</TabPanel>
            <TabPanel>2</TabPanel>
          </Tabs>
        </div>
      </MobileLayoutLevel2>
    </Fragment>
  );
};

export default EditUserInfo;
